// src/App.js

import React from 'react';
import UserForm from './components/UserForm';
import UserList from './components/UserList';


function App() {
  return (
    <div className="App">
      <h1>User Registration Form</h1>
      <UserForm />
      <h1>This list is registed users</h1>
      <UserList />
    </div>
  );
}

export default App;
